import React from 'react';
import interactiveImg from '../images/image-interactive.jpg';

const Interactive = () => {
  return (
    <>
    <section>
      <div>
        <img src={interactiveImg} alt="" />
      </div>
      <div>
        h2
      </div>
    </section>
    </>
  )
}

export default Interactive
